uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// User Parameters
uniform float u_speed;
uniform float u_camera_dist;
uniform float u_morph_speed;
uniform float u_bloom;

out vec4 fragColor;

// --- Math Utilities ---
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

float smin(float a, float b, float k) {
    float h = clamp(0.5 + 0.5 * (b - a) / k, 0.0, 1.0);
    return mix(b, a, h) - k * h * (1.0 - h);
}

// --- Noise ---
float hash(vec3 p) {
    p = fract(p * 0.3183099 + 0.1);
    p *= 17.0;
    return fract(p.x * p.y * p.z * (p.x + p.y + p.z));
}

// --- Geometry: Melting Clocks and Surreal Shapes ---
float sdSphere(vec3 p, float s) { return length(p) - s; }

float sdClock(vec3 p) {
    // Distort p to look "melted"
    float distortion = sin(p.y * 2.0 + iTime * u_morph_speed) * 0.3;
    p.x += distortion;
    p.z += cos(p.y * 1.5) * 0.2;

    // Main face
    float d = length(p * vec3(1.0, 0.6, 1.2)) - 1.5;
    // Rim
    float d2 = length(p * vec3(1.1, 0.7, 1.3)) - 1.55;
    d = max(d, -d2);

    // Hands (stylized cylinders)
    vec3 hp = p;
    hp.xy *= rot(1.5);
    float hand1 = length(hp.xz) - 0.05;
    hand1 = max(hand1, abs(hp.y) - 1.0);

    return smin(d, hand1, 0.1);
}

float sdStiltLeg(vec3 p) {
    p.x += sin(p.y * 0.5) * 0.2;
    return length(p.xz) - 0.02 * (1.0 + p.y * 0.1);
}

// Global Path for the "Parallel Rail" movement
vec2 getPath(float z) {
    return vec2(sin(z * 0.2), cos(z * 0.12)) * 3.5;
}

// --- Scene Mapping ---
vec2 map(vec3 p) {
    vec2 res = vec2(1e10, 0.0);

    // Infinite desert floor
    float floorDist = p.y + 2.0 + sin(p.x * 0.5) * 0.2 * cos(p.z * 0.5);
    res = (floorDist < res.x) ? vec2(floorDist, 1.0) : res;

    // Create repeating "Dream Objects"
    vec3 p_obj = p;
    p_obj.xy -= getPath(p_obj.z);

    float z_id = floor(p_obj.z / 15.0);
    p_obj.z = mod(p_obj.z, 15.0) - 7.5;

    // Object 1: Melting Clock
    vec3 p_clock = p_obj - vec3(2.0, 1.0, 0.0);
    p_clock.yz *= rot(sin(z_id + iTime * 0.5));
    float dClockObj = sdClock(p_clock);
    if(dClockObj < res.x) res = vec2(dClockObj, 2.0);

    // Object 2: Surreal Elephant (Abstracted as stilts and a mass)
    vec3 p_elephant = p_obj - vec3(-3.0, 2.0, 3.0);
    float body = sdSphere(p_elephant, 0.8 + 0.2 * sin(iTime + z_id));
    float leg1 = sdStiltLeg(p_elephant + vec3(0.5, 4.0, 0.5));
    float leg2 = sdStiltLeg(p_elephant + vec3(-0.5, 4.0, 0.5));
    float dElephant = smin(body, min(leg1, leg2), 0.4);
    if(dElephant < res.x) res = vec2(dElephant, 3.0);

    // Distant Floating Eye / Sun
    float dSun = length(p - vec3(20.0, 15.0, p.z + 50.0)) - 5.0;
    if(dSun < res.x) res = vec2(dSun, 4.0);

    return res;
}

// --- Rendering ---
vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.001, 0.0);
    return normalize(vec3(
        map(p + e.xyy).x - map(p - e.xyy).x,
        map(p + e.yxy).x - map(p - e.yxy).x,
        map(p + e.yyx).x - map(p - e.yyx).x
    ));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    float t = iTime * u_speed;

    // Camera Rail Logic
    vec3 pathPos = vec3(0.0, 0.0, t);
    pathPos.xy += getPath(pathPos.z);

    vec2 railVec = vec2(cos(t * 0.1), sin(t * 0.1)) * u_camera_dist;
    vec3 ro = pathPos;
    ro.xy += railVec;
    ro.y += 1.5; // Lift camera slightly

    vec3 ta = vec3(0.0, 0.0, t + 10.0);
    ta.xy += getPath(ta.z) + railVec * 0.5;

    vec3 f = normalize(ta - ro);
    vec3 r = normalize(cross(vec3(0, 1, 0), f));
    vec3 u = cross(f, r);
    vec3 rd = normalize(f + uv.x * r + uv.y * u);

    // Raymarching
    float d = 0.0, t_dist = 0.01;
    vec2 res;
    for(int i = 0; i < 100; i++) {
        res = map(ro + rd * t_dist);
        if(res.x < 0.001 || t_dist > 80.0) break;
        t_dist += res.x;
    }

    // Background Color (Dali Sky: Orange to Blue gradient)
    vec3 sky = mix(vec3(0.9, 0.6, 0.3), vec3(0.2, 0.5, 0.8), clamp(rd.y + 0.3, 0.0, 1.0));
    vec3 col = sky;

    if(t_dist < 80.0) {
        vec3 p = ro + rd * t_dist;
        vec3 n = getNormal(p);
        vec3 lightPos = vec3(20.0, 30.0, t + 20.0);
        vec3 l = normalize(lightPos - p);

        float diff = max(dot(n, l), 0.0);
        float spec = pow(max(dot(reflect(-l, n), -rd), 0.0), 32.0);

        // Material Coloring
        vec3 matCol = vec3(1.0);
        if(res.y == 1.0) { // Sand
            matCol = vec3(0.8, 0.7, 0.5) + 0.1 * hash(p * 10.0);
        } else if(res.y == 2.0) { // Clock
            matCol = vec3(0.95, 0.9, 0.7);
            if(length(fract(p.xy*2.0)-0.5) < 0.4) matCol *= 0.8; // Grid-like markings
        } else if(res.y == 3.0) { // Elephant
            matCol = vec3(0.4, 0.4, 0.45);
        } else if(res.y == 4.0) { // Sun/Eye
            matCol = vec3(1.0, 0.9, 0.2);
            diff = 2.0; // Emissive
        }

        col = matCol * (diff + 0.2) + spec;

        // Distance Fog
        col = mix(col, sky, 1.0 - exp(-0.005 * t_dist * t_dist));
    }

    // Post-processing: Dreamy Vignette and Grain
    float vignette = 1.0 - length(uv) * 0.5;
    col *= vignette;
    col += (hash(vec3(uv, iTime)) - 0.5) * 0.05;

    // Bloom/Glow on highlights
    col += pow(max(col.r - 0.7, 0.0), 2.0) * u_bloom;

    fragColor = vec4(col, 1.0);
}
